import "./videoSmall.css";

const VideoSmall = () => {
    return (
        <div className="videoSmall">
            <img
                src="https://i.ytimg.com/vi/9pqJT6xO3Ps/maxresdefault.jpg"
                alt=""
                className="videoSmall__img"
            />
        </div>
    );
};

export default VideoSmall;
